    #include <Windows.h>

    void run(const char *path) {
        PROCESS_INFORMATION pi;
        STARTUPINFO si;
        memset(&si, 0, sizeof si);
        si.cb = sizeof si;

        bool ret = CreateProcess(path, NULL, NULL, NULL, false, 0, NULL, NULL, &si, &pi);
        if(!ret)
            return;

        CloseHandle(pi.hProcess);
        CloseHandle(pi.hThread);
    }

