    uint8_t iv[] = IV;
    SIZ size = ENC_SIZE;

    /* Decrypt */
    struct AES_ctx context;
    AES_init_ctx_iv(&context, key, iv);
    AES_CBC_decrypt_buffer(&context, content, size);

